div.div:
curl
-u ${{ secrets.DEPLOYER_USERNAME }}:${{ secrets.DEPLOYER_PASSWORD }}
-X PATCH
-d '{
"service":"micro-nav",
"url":"https://storage.googleapis.com/
${{ secrets.GCS_BUCKET_NAME }}/'"$REPOSITORY_NAME"'/'"$GITHUB_SHA"'/main.js"
}'
"http://${{ secrets.DEPLOYER_HOST }}/services?env=test"

service: micro-nav
url : https://storage.googleapis.com/
bucket/repo_name/hash/build_artifacts[.html, .js, .cssm, *.*]
// converts "service" to be a "key" and "url" to be the "value" of an object inside "import-map.json"
// adds new or rewrites existing value by the "key"
{ "micro-nav": "{bucket}/{repo_name}/{hash}/[...build_artifacts] }
